INSERT INTO `SYSTEM_VARIABLES` VALUES ('INNODB_DEFRAGMENT_FILL_FACTOR',NULL,'0.900000','COMPILE-TIME','0.900000','GLOBAL','DOUBLE','A number between [0.7, 1] that tells defragmentation how full it should fill a page. Default is 0.9. Number below 0.7 won\'t make much sense.This variable, together with innodb_defragment_fill_factor_n_recs, is introduced so defragmentation won\'t pack the page too full and cause page split on the next insert on every page. The variable indicating more defragmentation gain is the one effective.','0.7','1',NULL,NULL,'NO','REQUIRED'),('PERFORMANCE_SCHEMA',NULL,'OFF','COMPILE-TIME','OFF','GLOBAL','BOOLEAN','Enable the performance schema.',NULL,NULL,NULL,'OFF,ON','YES','OPTIONAL'),('SQL_MODE','','STRICT_TRANS_TABLES,ERROR_FOR_DIVISION_BY_ZERO,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION','COMPILE-TIME','STRICT_TRANS_TABLES,ERROR_FOR_DIVISION_BY_ZERO,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION','SESSION','SET','Sets the sql mode',NULL,NULL,NULL,'REAL_AS_FLOAT,PIPES_AS_CONCAT,ANSI_QUOTES,IGNORE_SPACE,IGNORE_BAD_TABLE_OPTIONS,ONLY_FULL_GROUP_BY,NO_UNSIGNED_SUBTRACTION,NO_DIR_IN_CREATE,POSTGRESQL,ORACLE,MSSQL,DB2,MAXDB,NO_KEY_OPTIONS,NO_TABLE_OPTIONS,NO_FIELD_OPTIONS,MYSQL323,MYSQL40,ANSI,NO_AUTO_VALUE_ON_ZERO,NO_BACKSLASH_ESCAPES,STRICT_TRANS_TABLES,STRICT_ALL_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ALLOW_INVALID_DATES,ERROR_FOR_DIVISION_BY_ZERO,TRADITIONAL,NO_AUTO_CREATE_USER,HIGH_NOT_PRECEDENCE,NO_ENGINE_SUBSTITUTION,PAD_CHAR_TO_FULL_LENGTH,EMPTY_STRING_IS_NULL,SIMULTANEOUS_ASSIGNMENT','NO','REQUIRED'),('PERFORMANCE_SCHEMA_EVENTS_WAITS_HISTORY_LONG_SIZE',NULL,'-1','COMPILE-TIME','-1','GLOBAL','BIGINT','Number of rows in EVENTS_WAITS_HISTORY_LONG. Use 0 to disable, -1 for automated sizing.','-1','1048576','1',NULL,'YES','REQUIRED'),('SLAVE_RUN_TRIGGERS_FOR_RBR',NULL,'NO','COMPILE-TIME','NO','GLOBAL','ENUM','Modes for how triggers in row-base replication on slave side will be executed. Legal values are NO (default), YES and LOGGING. NO means that trigger for RBR will not be running on slave. YES and LOGGING means that triggers will be running on slave, if there was not triggers running on the master for the statement. LOGGING also means results of that the executed triggers work will be written to the binlog.',NULL,NULL,NULL,'NO,YES,LOGGING','NO','REQUIRED'),('PERFORMANCE_SCHEMA_MAX_COND_CLASSES',NULL,'80','COMPILE-TIME','80','GLOBAL','BIGINT UNSIGNED','Maximum number of condition instruments.','0','256','1',NULL,'YES','REQUIRED'),('PERFORMANCE_SCHEMA_EVENTS_STAGES_HISTORY_LONG_SIZE',NULL,'-1','COMPILE-TIME','-1','GLOBAL','BIGINT','Number of rows in EVENTS_STAGES_HISTORY_LONG. Use 0 to disable, -1 for automated sizing.','-1','1048576','1',NULL,'YES','REQUIRED'),('PERFORMANCE_SCHEMA_MAX_COND_INSTANCES',NULL,'-1','COMPILE-TIME','-1','GLOBAL','BIGINT','Maximum number of instrumented condition objects. Use 0 to disable, -1 for automated sizing.','-1','1048576','1',NULL,'YES','REQUIRED'),('HAVE_GEOMETRY',NULL,'YES','COMPILE-TIME',NULL,'GLOBAL','VARCHAR','If the server supports spatial data types, will be set to YES, otherwise will be set to NO.',NULL,NULL,NULL,NULL,'YES',NULL),('PERFORMANCE_SCHEMA_MAX_RWLOCK_CLASSES',NULL,'40','COMPILE-TIME','40','GLOBAL','BIGINT UNSIGNED','Maximum number of rwlock instruments.','0','256','1',NULL,'YES','REQUIRED'),('INNODB_FLUSH_LOG_AT_TIMEOUT',NULL,'1','COMPILE-TIME','1','GLOBAL','INT UNSIGNED','Write and flush logs every (n) second.','0','2700','0',NULL,'NO','OPTIONAL'),('SLAVE_PARALLEL_THREADS',NULL,'0','COMPILE-TIME','0','GLOBAL','BIGINT UNSIGNED','If non-zero, number of threads to spawn to apply in parallel events on the slave that were group-committed on the master or were logged with GTID in different replication domains. Note that these threads are in addition to the IO and SQL threads, which are always created by a replication slave','0','16383','1',NULL,'NO','REQUIRED'),('INNODB_ENCRYPT_TEMPORARY_TABLES',NULL,'OFF','COMPILE-TIME','OFF','GLOBAL','BOOLEAN','Enrypt the temporary table data.',NULL,NULL,NULL,'OFF,ON','YES','OPTIONAL'),('LAST_GTID','',NULL,'COMPILE-TIME',NULL,'SESSION ONLY','VARCHAR','The GTID of the last commit (if binlogging was enabled), or the empty string if none.',NULL,NULL,NULL,NULL,'YES',NULL),('SLAVE_EXEC_MODE',NULL,'STRICT','COMPILE-TIME','STRICT','GLOBAL','ENUM','How replication events should be executed. Legal values are STRICT (default) and IDEMPOTENT. In IDEMPOTENT mode, replication will not stop for operations that are idempotent. For example, in row based replication attempts to delete rows that doesn\'t exist will be ignored. In STRICT mode, replication will stop on any unexpected difference between the master and the slave.',NULL,NULL,NULL,'STRICT,IDEMPOTENT','NO','REQUIRED'),('PERFORMANCE_SCHEMA_MAX_MUTEX_INSTANCES',NULL,'-1','COMPILE-TIME','-1','GLOBAL','BIGINT','Maximum number of instrumented MUTEX objects. Use 0 to disable, -1 for automated sizing.','-1','104857600','1',NULL,'YES','REQUIRED'),('ERROR_COUNT','0',NULL,'COMPILE-TIME',NULL,'SESSION ONLY','BIGINT UNSIGNED','The number of errors that resulted from the last statement that generated messages','0','18446744073709551615','1',NULL,'YES',NULL),('PERFORMANCE_SCHEMA_MAX_RWLOCK_INSTANCES',NULL,'-1','COMPILE-TIME','-1','GLOBAL','BIGINT','Maximum number of instrumented RWLOCK objects. Use 0 to disable, -1 for automated sizing.','-1','104857600','1',NULL,'YES','REQUIRED'),('ENCRYPT_TMP_DISK_TABLES',NULL,'OFF','COMPILE-TIME','OFF','GLOBAL','BOOLEAN','Encrypt temporary on-disk tables (created as part of query execution)',NULL,NULL,NULL,'OFF,ON','NO','OPTIONAL'),('PERFORMANCE_SCHEMA_MAX_MUTEX_CLASSES',NULL,'200','COMPILE-TIME','200','GLOBAL','BIGINT UNSIGNED','Maximum number of mutex instruments.','0','256','1',NULL,'YES','REQUIRED'),('INNODB_STATS_TRANSIENT_SAMPLE_PAGES',NULL,'8','COMPILE-TIME','8','GLOBAL','BIGINT UNSIGNED','The number of leaf index pages to sample when calculating transient statistics (if persistent statistics are not used, default 8)